styles:
.sky-toolbar-container {
  min-height: 49px;
  background-color: #ffffff;
  padding: 5px 10px;
  border-top: 1px solid #cdcfd2;
  border-bottom: 1px solid #cdcfd2;
  display: flex;
  align-items: center;
  position: relative;
}

.sky-toolbar-container /deep/ sky-toolbar-section:not(:first-child) .sky-toolbar-section {
  border-top: 1px solid #cdcfd2;
}

.sky-toolbar-sectioned {
  display: block;
  padding: 0;
}

